import React from "react";
import PropsType from "prop-types";
import "./footer-info.css";

const FooterInfo = ({ label, className, role, clearCompletedTasks }) => {
  function onKeyDownInfoHandler(e) {
    if (e.keyCode === 13) clearCompletedTasks();
    return "";
  }

  return (
    // eslint-disable-next-line jsx-a11y/no-static-element-interactions
    <span
      role={role}
      // role="button"
      onClick={clearCompletedTasks}
      onKeyDown={onKeyDownInfoHandler}
      className={className}
    >
      {label}
    </span>
  );
};

FooterInfo.defaultProps = { clearCompletedTasks: () => {} };

FooterInfo.propTypes = {
  clearCompletedTasks: PropsType.func,
  className: PropsType.string.isRequired,
  label: PropsType.string.isRequired,
  role: PropsType.string.isRequired,
};

export default FooterInfo;
